import React from 'react';
import { Link } from 'react-router-dom';
import '../css/user_type.css';
import { clickHandlerEmployer } from '../utils/employer_handler';
import { clickHandlerEmployee } from '../utils/employee_handler';


function UserType() {
  return (
    <React.Fragment>
      <div className='user-type'>
        <div>
          <a onClick={(clickHandlerEmployer)}>Sign Up As An Employer</a>
        </div>
        <div>
          <a onClick={(clickHandlerEmployee)}>Sign Up As A job Seeker</a>
        </div>
      </div>
    </React.Fragment>
  )
}

export default UserType;
